import { StatusBar } from "expo-status-bar";
import React, { useState } from "react";
import { Ionicons } from "@expo/vector-icons";
import {
  StyleSheet,
  Text,
  SafeAreaView,
  View,
  TouchableOpacity,
  Touchable,
} from "react-native";
import SimpleCard from '../components/cardView'
export default function App() {
  const usuario = "Gerssivaldo";
  const faturaAtual = "R$ 5,31";
  const saldoDisponivel = "R$ 8,90";
  const [isHidde, setisHidde] = useState(false);
  return (
    <SafeAreaView style={styles.container}>
      <StatusBar
        barStyle="light-content"
        hidden={false}
        backgroundColor="#6a0f8c"
        style={"light"}
        translucent={false}
        networkActivityIndicatorVisible={true}
      />
      <View style={styles.header}>

        <Text style={styles.headerText}>Ol√°, {usuario}</Text>

        <TouchableOpacity 
        style={styles.buttonHidde}
        onPress={()=> setisHidde(!isHidde)}>
          <Ionicons
            size={23}
            style={{ color: "white" }}
            name={isHidde ? "ios-eye-outline" : "ios-eye-off-outline"}
          />
        </TouchableOpacity>

        <TouchableOpacity style={styles.buttonSettings}>
          <Ionicons 
          name="ios-settings-outline"
          size={23}
          style={{ color: "white" }}></Ionicons>
        </TouchableOpacity>
      </View>

      <View>
      <SimpleCard/>
      </View>
    </SafeAreaView>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: "#8914b5",
    alignItems: "center",
    justifyContent: "flex-start",
  },
  header: {
    /* backgroundColor:'green', */
    width: "100%",
    height: "12%",
    alignItems: "center",
    justifyContent: "center",
    flexDirection: "row",
  },
  headerText: {
    position: "absolute",
    fontSize: 26,
    color: "white",
    fontWeight: "bold",
    left: "5%",
  },
  buttonHidde: {
    position: "absolute",
    width: 52,
    height: 52,
    backgroundColor: "#8834a8",
    justifyContent: "center",
    alignItems: "center",
    right: "20%",
    borderRadius: 50,
  },
  buttonSettings:{
    position: "absolute",
    width: 52,
    height: 52,
    backgroundColor: "#8834a8",
    justifyContent: "center",
    alignItems: "center",
    right: "5%",
    borderRadius: 50,
  }
});
